import React from 'react'
import { SidebarData } from './SidebarData'
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import './Sidebar.css';

function Sidebar() {
    return (
        <div className="Sidebar">   
        <ul>
            {SidebarData.map((val,key) => {
                return (
                    <li key={key}>
                        {" "}
                        <div>{val.icon}</div>
                        <div>
                            {val.title}
                        </div>
                    </li>
                )
            })}
        </ul>

        </div>
    )
}

export default Sidebar
